import React from 'react';
import Flip from './flip';
import Title from '../title';

const flip = [
  {
    Ftitle: 'Tráfego pago',
    Ftext: 'Conteúdo do Card 1',
    Btitle: 'Topo das pesquisas',
    Btext: 'Conteúdo do Card 2',
  },
  {
    Ftitle: 'Tráfego pago',
    Ftext: 'Conteúdo do Card 1',
    Btitle: 'Topo das pesquisas',
    Btext: 'Conteúdo do Card 2',
  },
];
const flip2 = [
  {
    Ftitle: 'Whatsapp business',
    Ftext: 'Conteúdo do Card 3',
    Btitle: 'Website moderno',
    Btext: 'Conteúdo do Card 4',
  },
  {
    Ftitle: 'Whatsapp business',
    Ftext: 'Conteúdo do Card 3',
    Btitle: 'Website moderno',
    Btext: 'Conteúdo do Card 4',
  },
];

export default function Fliper() {
  return (
    <section className=" h-[100%] flex z-1 items-center pt-[46px] flex-col bg-fuchsia-950">
      <Title title={'Qual a sua necessidade ?'} />
      <div className=" flex max-w-7xl items-center  grid-cols-4 gap-[25px] flex-row">
        <div className="  flex items-center mb-[32px] gap-[25px] flex-row ">
          {flip.map((card, index) => (
            <Flip
              key={index}
              Ftitle={card.Ftitle}
              Ftext={card.Ftext}
              Btitle={card.Btitle}
              Btext={card.Btext}
            />
          ))}
        </div>
        <div className="  flex items-center mb-[32px] gap-[25px] flex-row ">
          {flip2.map((card, index) => (
            <Flip
              key={index}
              Btitle={card.Btitle}
              Btext={card.Btext}
              Ftitle={card.Ftitle}
              Ftext={card.Ftext}
            />
          ))}
        </div>
      </div>
    </section>
  );
}
